import logo from "./logo-cultupaz.jpg";
import "./App.css";
//importamos usuarios
import CompShowUsers from "./user/ShowUsers";

import { BrowserRouter, Route, Router, Routes } from "react-router-dom";
import CompEditUser from "./user/EditUser";
import CompNavbar  from "./user/navegacion/navbar"; //impotamos navbar la carpeta user/ de la carpeta navegacion/navar.js
import Sidebar from "./user/navegacion/inicio";



function App() {
  //componentes de usuarios
  return (
    <div className="App">
      <header className="App-header">
      <Sidebar />
      </header>
      <BrowserRouter>
        <Routes>

          <Route path="/" element={<CompShowUsers />} />
          <Route path="/edit/:id" element={<CompEditUser />} />
        </Routes>
      </BrowserRouter>


    </div>
  );




}

export default App;
